import React from 'react';
import { Typography, Box, Button } from '@mui/material';
import html2canvas from 'html2canvas';
import jsPDF from 'jspdf';

interface PolicyHolder {
  firstName: string;
  lastName: string;
  email: string;
  address: string;
}

type PolicyType = 'standard' | 'premium';

interface HurricaneDetails {
  category: number;
}

interface ReceiptProps {
  policyHolder: PolicyHolder;
  policyType: PolicyType;
  hurricaneDetails: HurricaneDetails;
  date: string;
}

const ReceiptComponent: React.FC<ReceiptProps> = ({
  policyHolder,
  policyType,
  hurricaneDetails,
  date,
}) => {
  // Pricing data
  const pricingData: { [key in PolicyType]: { category: number; payment: number }[] } = {
    standard: [
      { category: 5, payment: 1000 },
      { category: 4, payment: 800 },
      { category: 3, payment: 350 },
      { category: 2, payment: 100 },
      { category: 1, payment: 25 },
    ],
    premium: [
      { category: 5, payment: 2000 },
      { category: 4, payment: 1600 },
      { category: 3, payment: 700 },
      { category: 2, payment: 200 },
      { category: 1, payment: 50 },
    ],
  };

  const getPaymentAmount = (policyType: PolicyType, category: number): number => {
    const paymentInfo = pricingData[policyType].find(p => p.category === category);
    return paymentInfo ? paymentInfo.payment : 0;
  };

  const totalPayment = getPaymentAmount(policyType, hurricaneDetails.category);

  const handleSaveReceipt = () => {
    const contentForPDF = document.getElementById('content-for-pdf');
  
    if (contentForPDF) {
      html2canvas(contentForPDF, { scale: 2 }).then(canvas => {
        const imgData = canvas.toDataURL('image/png');
        const pdf = new jsPDF('p', 'mm', 'a4');
  
        // Add the screenshot to the PDF
        pdf.addImage(imgData, 'PNG', 10, 10, 190, 190); // Adjust dimensions as needed
  
        // Signature image (base64 string)
        const signatureImage = 'data:image/png;base64,'; // this is the image in the pd
        // Calculate the position to place the signature at the bottom of the page
        const pageWidth = pdf.internal.pageSize.getWidth();
        const pageHeight = pdf.internal.pageSize.getHeight();
        const signatureWidth = 120; // Adjust based on the actual size of your signature
        const signatureHeight = 80; // Adjust based on the actual size of your signature
        const signatureX = (pageWidth / 2) - (signatureWidth / 2); // Center horizontally
        // const signatureX = pageWidth - signatureWidth - 10; // 10mm from the right edge
        const signatureY = pageHeight - signatureHeight - 10; // 10mm from the bottom edge
  
        // Add the signature image to the PDF
        pdf.addImage(signatureImage, 'PNG', signatureX, signatureY, signatureWidth, signatureHeight);
  
        // Save the PDF
        pdf.save('receipt.pdf');
      });
    }
  };

  return (
    <Box sx={{
      padding: 2,
      backgroundColor: '#f5f5f5',
      borderRadius: '8px',
      boxShadow: '0 2px 4px rgba(0,0,0,.1)',
      width: '500px',
      position: 'relative'
    }}>
      <div id="content-for-pdf">
        <Typography 
          variant="h4" 
          gutterBottom 
          sx={{ 
            fontWeight: 'bold', 
            marginBottom: '16px', 
            display: 'flex', 
            justifyContent: 'space-between', 
            alignItems: 'center',
            color: 'black'
          }}>
          Receipt
          <span style={{color: 'black'}}>Date: {date}</span>
        </Typography>
        <Typography sx={{ color: 'black', marginBottom: '8px' }}>Policy Holder: {policyHolder.firstName} {policyHolder.lastName}</Typography>
        <Typography sx={{ color: 'black', marginBottom: '8px' }}>Email: {policyHolder.email}</Typography>
        <Typography sx={{ color: 'black', marginBottom: '8px' }}>Address: {policyHolder.address}</Typography>
        <Typography sx={{ color: 'black', marginBottom: '16px' }}>
          Policy Type: {policyType.charAt(0).toUpperCase() + policyType.slice(1)} Policy ${policyType === 'standard' ? '50' : '100'}
        </Typography>
        <Typography sx={{ fontWeight: 'bold', color: 'error.main', marginBottom: '8px' }}>Hurricane Category: {hurricaneDetails.category}</Typography>
        <Typography sx={{ fontWeight: 'bold', color: 'success.main' }}>Total Payment: ${totalPayment}</Typography>
      </div>
      <Button variant="contained" onClick={handleSaveReceipt} sx={{ marginTop: '16px' }}>Save Receipt as PDF</Button>
    </Box>
  );
};

export default ReceiptComponent;
